        #region DeepCopyIn
        public void DeepCopyIn(
            IDestructible item,
            IDestructibleGetter rhs,
            ErrorMaskBuilder? errorMask,
            TranslationCrystal? copyMask,
            bool deepCopy)
        {
            if ((copyMask?.GetShouldTranslate((int)Destructible_FieldIndex.Data) ?? true))
            {
                errorMask?.PushIndex((int)Destructible_FieldIndex.Data);
                try
                {
                    if(rhs.Data.TryGet(out var rhsData))
                    {
                        item.Data = rhsData.DeepCopy(
                            errorMask: errorMask,
                            copyMask?.GetSubCrystal((int)Destructible_FieldIndex.Data));
                    }
                    else
                    {
                        item.Data = default;
                    }
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
            if ((copyMask?.GetShouldTranslate((int)Destructible_FieldIndex.Stages) ?? true))
            {
                errorMask?.PushIndex((int)Destructible_FieldIndex.Stages);
                try
                {
                    item.Stages.SetTo(
                        rhs.Stages
                        .Select(r =>
                        {
                            return r.DeepCopy(
                                errorMask: errorMask,
                                default(TranslationCrystal));
                        }));
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
        }
        
        #endregion
        
        public Destructible DeepCopy(
            IDestructibleGetter item,
            Destructible.TranslationMask? copyMask = null)
        {
            Destructible ret = (Destructible)((DestructibleCommon)((IDestructibleGetter)item).CommonInstance()!).GetNew();
            ((DestructibleSetterTranslationCommon)((IDestructibleGetter)ret).CommonSetterTranslationInstance()!).DeepCopyIn(
                item: ret,
                rhs: item,
                errorMask: null,
                copyMask: copyMask?.GetCrystal(),
                deepCopy: true);
            return ret;
        }
        
        public Destructible DeepCopy(
            IDestructibleGetter item,
            out Destructible.ErrorMask errorMask,
            Destructible.TranslationMask? copyMask = null)
        {
            var errorMaskBuilder = new ErrorMaskBuilder();
            Destructible ret = (Destructible)((DestructibleCommon)((IDestructibleGetter)item).CommonInstance()!).GetNew();
            ((DestructibleSetterTranslationCommon)((IDestructibleGetter)ret).CommonSetterTranslationInstance()!).DeepCopyIn(
                ret,
                item,
                errorMask: errorMaskBuilder,
                copyMask: copyMask?.GetCrystal(),
                deepCopy: true);
            errorMask = Destructible.ErrorMask.Factory(errorMaskBuilder);
            return ret;
        }
        
